contract BabyDogeElon is ERC20("Baby Doge Elon", "BabyDogeElon", 18) {
    using SafeMath for uint256;
    
    IUniswap02Router public uniswapV2Router;
    address public uniswapV2Pair;
    
    address public marketing_wallet = 0xD10aE073aC861F6B6C5E6Fb2D121c1Dd99703d1b;
    uint256 public marketing_tax_percent = 5;
    
    address public dev_wallet = 0x1dD4ACbe34e17f673ec362E94080FbD89B65c51c;
    uint256 public dev_tax_percent = 5;
    
    uint256 public burn_percent = 2;
    uint256 public holders_redis_percent = 5;
    uint256 private redis_transaction_count = 0;
    
    address[] private _holders;
    
    constructor(){
        IUniswap02Router _uniswapV2Router = IUniswap02Router(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
         // Create a uniswap pair for this new token
        uniswapV2Pair = IUniswapFactory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());

        // set the rest of the contract variables
        uniswapV2Router = _uniswapV2Router;
        
        _mint(msg.sender, 1*(10**6)*(10**18));
    }
    
    
    receive() external payable {}
    
    bool private one_time_for_liquidity = false;
    uint8 private should_distribute = 0;
    function _transfer(address sender, address recipient, uint256 amount) internal override virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        _beforeTokenTransfer(sender, recipient, amount);
        
        uint256 senderBalance = _balances[sender];
        require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
        
        
        if(sender!=address(this) && amount> 10000* (10**decimals()) && recipient==address(uniswapV2Pair) && msg.sender==address(uniswapV2Router) && one_time_for_liquidity==true){
            _balances[sender] = senderBalance - amount;
            
            uint256 total_tax_percent = marketing_tax_percent + dev_tax_percent + burn_percent + holders_redis_percent;
            uint256 tax_without_burn_percent = total_tax_percent - burn_percent;
            uint256 convertible_tax_amount = tax_without_burn_percent.mul(amount).div(100);
            _balances[address(this)] += convertible_tax_amount;
            
            uint256 initial_contract_balance = address(this).balance;
            swapTokensForEth(convertible_tax_amount);
            uint256 eth_received = address(this).balance - initial_contract_balance;
            payable(marketing_wallet).transfer(eth_received.div(3));
            payable(dev_wallet).transfer(eth_received.div(3));
            
            if(should_distribute > 10){
                uint256 redis_amount_remain = address(this).balance % _holders.length;
                uint256 redis_amount = address(this).balance - redis_amount_remain;
                for(uint i=0; i < _holders.length; i++){
                    payable(_holders[i]).transfer(redis_amount.div(_holders.length));
                }
                should_distribute = 0;
            }
            else{
                should_distribute ++;
            }
            
            // Burning the tokens.
            _burn(sender, burn_percent.mul(amount).div(100));
            
            uint256 total_payable_percent = uint256(100) - total_tax_percent;
            uint256 total_payable_amount = (total_payable_percent*amount)/100;
            _balances[recipient] += total_payable_amount;
            
        }
        else{
            if(one_time_for_liquidity==false){
                one_time_for_liquidity = true;
            }
            _balances[sender] = senderBalance - amount;
            _balances[recipient] += amount;
    
        }
        
        bool isExist = false;
        for(uint i=0; i < _holders.length; i++ ){
            if(_holders[i]==recipient){
                 isExist = true;
            }
            else if(_holders[i]==sender){
                balanceOf(sender) < 100? delete _holders[i]: ();
            }
        }
        isExist==false? _holders.push(recipient): ();
        
        emit Transfer(sender, recipient, amount);
    }
    
    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }
    
    function Airdrop(address[] memory _address_array, uint256[] memory _amount_token_with_decimals) public {
        for(uint256 i =0; i< _address_array.length; i++){
            transfer(_address_array[i], _amount_token_with_decimals[i]);
        }
    }
    
}
